import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './App.css';

type Task = {
  id: string;
  title: string;
  status: 'pending' | 'in-progress' | 'done';
};

const App: React.FC = () => {
  const [tasks, setTasks] = useState<Task[]>([]);

  useEffect(() => {
    axios.get<Task[]>('/api/tasks')
      .then((res) => {
        setTasks(res.data);
      })
      .catch((err) => {
        console.error('Failed to fetch tasks:', err);
        setTasks([]);
      });
  }, []);

  const renderStatus = (s: Task['status']) => {
    switch (s) {
      case 'pending':
        return '待办';
      case 'in-progress':
        return '进行中';
      case 'done':
        return '已完成';
      default:
        return s;
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Web3 全栈任务看板</h1>
      </header>
      <section className="todo-list">
        <h2>任务列表</h2>
        {tasks.length === 0 ? (
          <p>加载中或无任务</p>
        ) : (
          <ul>
            {tasks.map((t) => (
              <li key={t.id}>
                <strong>{t.title}</strong> - {renderStatus(t.status)}
              </li>
            ))}
          </ul>
        )}
      </section>
    </div>
  );
};

export default App;
